import React from "react";
import { Form, Input, Button } from "antd";
import styled from "styled-components";

const FeedContent = styled(Input.TextArea)`
  resize: none;
  width: 100%;
  margin-bottom: 5px;
`;

const FeedCreatForm = () => {
  return (
    <div>
      <FeedContent allowClear={true} />
    </div>
  );
};

export default FeedCreatForm;
